import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = ({ session }) => (
    <div>

        console.log(session.getCurrentUser.username )
    </div>
//   <nav>{session && session.getCurrentUser ? <NavbarAuth /> : ""}</nav>

);

const NavbarAuth = ({ session }) => (
  <ul>
    {/* <li>Hi, {session.getCurrentUser.username}!</li> */}
    <li>
      <NavLink to="/" exact>
        Dashboard
      </NavLink>
    </li>
    <li>
      <NavLink to="/data" exact>
        Data
      </NavLink>
    </li>
    <li>
      <NavLink to="/settings" exact>
        Settings
      </NavLink>
    </li>
    <li>
      <NavLink to="/signout" exact>
        Signout
      </NavLink>
    </li>
    <li>
      <button>+ Add a Device</button>
    </li>
  </ul>
);

// const NavbarAuth = () => <ul></ul>;

export default Navbar;
